import { useState, useEffect } from 'react';
import axios from 'axios';

function App() {

  const [getDisplayList, setDisplayList] = useState(true)
  const [getAllCountries, setAllCountries] = useState([])

  const [getNotes, setNotes] = useState('Nothing found.')
  const [flag, setFlag] = useState(false)
  let notes = `i'm empty though`;

  axios.get(`https://restcountries.com/v3.1/all`).then((response) => {
    notes = response.data;
  }).catch((response) => {
    console.log('did not receive shieeet')
  })
  return (
    <>
      <>
        <h1>Work in Progress!</h1>
      </>
      <>
        <h1>{notes}</h1>
      </>
    </>
  )
}

export default App;
